			shellScript = "# use the mercurial revision number (which may or may not match the \"official\" repo on bitbucket) as the last component of the version number\nHG_REVISION_NUMBER=$(/usr/local/bin/hg log -r '.' --template \"{rev}\\n\" --repository \"${PROJECT_DIR}\")\n\n# use the project's Info.plist bundle version as the base of the version number\nBASE_VERSION_NUMBER=$(/usr/libexec/PlistBuddy -c \"Print :CFBundleVersion\" \"${PROJECT_DIR}/Info.plist\")\n\n# set the built bundle version based on the project bundle with the mercurial revision tacked on\n/usr/libexec/PlistBuddy -c \"Set :CFBundleVersion $BASE_VERSION_NUMBER.$HG_REVISION_NUMBER\" \"${TARGET_BUILD_DIR}/${INFOPLIST_PATH}\"\n\n# use the project's Info.plist short version string as a tag at the end of the version number for the actual built bundle short version string\nVERSION_STRING_TAG=$(/usr/libexec/PlistBuddy -c \"Print :CFBundleShortVersionString\" \"${PROJECT_DIR}/Info.plist\")\n\n# set the built bundle version based on the project bundle with the mercurial revision tacked on\n/usr/libexec/PlistBuddy -c \"Set :CFBundleShortVersionString $BASE_VERSION_NUMBER-$VERSION_STRING_TAG\" \"${TARGET_BUILD_DIR}/${INFOPLIST_PATH}\"\n\n# sign the bundle\n/usr/bin/codesign -f -s \"My Code Signing Certificate\" \"${BUILT_PRODUCTS_DIR}/${WRAPPER_NAME}/\"\n\nif [ $BUILD_STYLE = Release ]; then\n\t# remove any zip files in the build directory, then archive what we just built to a version-named zip file\n\trm -f \"$BUILT_PRODUCTS_DIR/$PROJECT_NAME\"*.zip\n\tditto -ck --keepParent \"$BUILT_PRODUCTS_DIR/$PROJECT_NAME.app\" \"$BUILT_PRODUCTS_DIR/$PROJECT_NAME-$BASE_VERSION_NUMBER.$HG_REVISION_NUMBER.zip\"\nfi";
